import React from 'react';
import './Checkout.css';
import Subtotal from './Subtotal';
import CheckoutProduct from './CheckoutProduct';
import { useStateValue } from './StateProvider';

function Checkout() {
    const [{basket},dispatch] = useStateValue();



    return (
        <div className ='checkout'>
            <div className = 'checkout-left'>
                {/* https://media.geeksforgeeks.org/img-practice/courses/GCLive_Slider_Web.png */}
                    <img className = 'checkout-ad' src = 'https://s0.2mdn.net/9944765/02012021-013654578-1.21_BannerAds_Trade100027.jpg' alt = ''/>


                <div className = 'checkout-title'>
                    <h2 className = 'checkout-title'>Your Shopping Basket</h2>

                    {basket.map(item => (
                        <CheckoutProduct
                        id={item.id}
                        title={item.title}
                        image={item.image}
                        price={item.price}
                        rating={item.rating}
                        />
                    ))}

                </div>
            </div>

            <div className = 'checkout-right'>
                <Subtotal/>
            </div>
        </div>
    )
}

export default Checkout
